import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class NavbarArea extends Component {
    render() {
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light mr-auto">
                <a class="navbar-brand" href="/">Exercise App</a>
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav mr-auto">
                        <li class="nav-item active">
                            <a class="nav-link" href="#">Exercise List <span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item active">
                            <a class="nav-link" href="#">Create Exercise <span class="sr-only">(current)</span></a>
                        </li><li class="nav-item active">
                            <a class="nav-link" href="#">Create User <span class="sr-only">(current)</span></a>
                        </li><li class="nav-item active">
                            <a class="nav-link" href="#">Edit Exercise <span class="sr-only">(current)</span></a>
                        </li>
                    </ul>
                </div>
            </nav>

        )
    }
}
